import React from 'react';
import './SectionOne.css';

export default class SectionOne extends React.Component {
  state = {
    bar: false,
    inchka: ' ',
  };

  Ber = () => {
    this.setState(() => {
      return {
        inchka: <i class='fas fa-heartbeat' />,
      };
    });
  };
  Ger = () => {
    this.setState(() => {
      return {
        inchka: <i class='fas fa-heartbeat' />,
      };
    });
  };

  render() {
    return (
      <div className='sectionone'>
        <i class='fas fa-heartbeat' onClick={this.Ber}></i>
        <i class='fas fa-heartbeat' onClick={this.Ger}></i>
        <h2>{this.state.inchka}</h2>
      </div>
    );
  }
}
